import React, { useEffect, useState } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import Divider from '@material-ui/core/Divider';
import ListItemText from '@material-ui/core/ListItemText';
import ListItemAvatar from '@material-ui/core/ListItemAvatar';
import Avatar from '@material-ui/core/Avatar';
import Typography from '@material-ui/core/Typography';
import { userService } from '../../services/user.service';

const useStyles = makeStyles((theme) => ({
    root: {
        width: '100%',
        maxWidth: '36ch',
        backgroundColor: theme.palette.background.paper,
    },
    inline: {
        display: 'inline',
    },
}));

export default function ListFriend(props) {
    const classes = useStyles();
    const [listFriend, setListFriend] = useState();
    useEffect(() => {
        userService.getFollwer(props.userId).then(res => {
            console.log(res.data.data.friendList[0].followers);
            setListFriend(res.data.data.friendList);
            // console.log(listFriend)
        }).catch(err => [
            console.log(err)
        ])
    }, [])
    return (
        <List className={classes.root}>
            {
                listFriend ? listFriend.map((ele) => {
                    return <ListItem alignItems="flex-start">
                        <ListItemAvatar>
                            <Avatar alt="Remy Sharp" src={ele.user.photo} />
                        </ListItemAvatar>
                        <ListItemText
                            primary={ele.user.firstname}
                            secondary={
                                <React.Fragment>
                                    <Typography
                                        component="span"
                                        variant="body2"
                                        className={classes.inline}
                                        color="textPrimary"
                                    >
                                        Ali Connors
                                    </Typography>
                                    {" — I'll be in your neighborhood doing errands this…"}
                                </React.Fragment>
                            }
                        />
                    </ListItem>
                }) : null
            }

            <Divider variant="inset" component="li" />


        </List>
    );
}
